import React from 'react';
import {Box, Button, useTheme } from '@mui/material';
import { tokens } from '../themes/themes';


export default function Sequance() {
    const theme = useTheme();
    const colors = tokens (theme.palette.mode);

  return (
    <Box display = {"flex"}>
        <Button name = "step1" sx={{background: colors.redAccent[500] }}></Button>
        <Button name = "step2" sx={{background: colors.redAccent[500] }}></Button>
        <Button name = "step3" sx={{background: colors.redAccent[500] }}></Button>
        <Button name = "step4" sx={{background: colors.redAccent[500] }}></Button>
        <Button name = "step5" sx={{background: colors.redAccent[500] }}></Button>

    </Box>
  )
}
